 side to one of Anjuna’s most illustrious producers. Well-known for his thunderous DJ sets and deep, bass-heavy house productions, ‘Erased Dreams’ may seem like a departure from Yotto’s usual style, but he’s always made music like this. With Reflections, he finally found a home for it.logseq____&quot;,536870960]],[logseq____&quot;^15logseq____&quot;,[1591,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870960]],[logseq____&quot;^15logseq____&quot;,[1591,logseq____&quot;^Flogseq____&quot;,1590,536870960]],[logseq____&quot;^15logseq____&quot;,[1591,logseq____&quot;^Xlogseq____&quot;,577,536870960]],[logseq____&quot;^15logseq____&quot;,[1591,logseq____&quot;^Vlogseq____&quot;,577,536870960]],[logseq____&quot;^15logseq____&quot;,[1591,logseq____&quot;^Ulogseq____&quot;,577,536870960]],[logseq____&quot;^15logseq____&quot;,[1591,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u6714d5fb-6d47-4b2f-88bc-2a5552c670bdlogseq____&quot;,536870960]],[logseq____&quot;^15logseq____&quot;,[1592,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Throughout his sparkling career, which includes a Billboard #1 LP and remixes of tracks by Joris Voorn, Gorillaz and Coldplay, Yotto has produced ambient music to help him look inward and re-charge his creative battery. But when COVID hit, his inner world took over. “At first, I was being really productive with club music. But then after a while I started making something completely opposite.” Yotto found himself exploring a different form of expression, with no plan other than to create. But when he put the tracks side-by-side in a playlist he recognised a synergy, and the outline of the project began to take shape. The result is more of a continuous soundscape than an album; an ethereal and dreamy experience designed to accompany the listener as they turn inward and drift away. If club music is a form of escape, then this is too – but instead of turning outward, we lose ourselves inward.logseq____&quot;,536870960]],[logseq____&quot;^15logseq____&quot;,[1592,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870960]],[logseq____&quot;^15logseq____&quot;,[1592,logseq____&quot;^Flogseq____&quot;,1591,536870960]],[logseq____&quot;^15logseq____&quot;,[1592,logseq____&quot;^Xlogseq____&quot;,577,536870960]],[logseq____&quot;^15logseq____&quot;,[1592,logseq____&quot;^Vlogseq____&quot;,577,536870960]],[logseq____&quot;^15logseq____&quot;,[1592,logseq____&quot;^Ulogseq____&quot;,577,536870960]],[logseq____&quot;^15logseq____&quot;,[1592,logseq____&quot;^Ulogseq____&quot;,1589,536870960]],[logseq____&quot;^15logseq____&quot;,[1592,logseq____&quot;^Hlogseq____&quot;,1589,536870960]],[logseq____&quot;^15logseq____&quot;,[1592,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u6714d5fb-f6c3-488c-9d77-56974cc560bblogseq____&quot;,536870960]],[logseq____&quot;^15logseq____&quot;,[1593,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;The first single is ‘Silhouette’. It’s a melancholy, atmospheric track with hints of ’80s nostalgia and smooth as glass vocals from Sansa. The track conjures up images of vast and endless landscapes; the sense of space enhanced by sparse chord-changes and field recordings of heavy rain. ‘Silhouette’ is so human it feels like an extension of an emotion, and Yotto says the idea came to him like a dream. A sound drifted towards him one day and he caught it by the tail and built on top of it until it became the entity he envisioned. ’It’s slow and steady and it grows. I think the beauty lies in the simplicity of it.”logseq____&quot;,536870960]],[logseq____&quot;^15logseq____&quot;,[1593,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870960]],[logseq____&quot;^15logseq____&quot;,[1593,logseq____&quot;^Flogseq____&quot;,1592,536870960]],[logseq____&quot;^15logseq____&quot;,[1593,logseq____&quot;^Xlogseq____&quot;,577,536870960]],[logseq____&quot;^15logseq____&quot;,[1593,logseq____&quot;^Vlogseq____&quot;,577,53
